import React from 'react';
import {
  ChakraProvider,
  Box,
  Text,
  Link,
  VStack,
  Code,
  Grid,
  Container,
  extendTheme,
} from '@chakra-ui/react';

const colors = {
  op: {
    900: '#A7C4D8',
    800: '#356FB0',
    700: '#336AAC',
    600: '#5FBDF4',
  },
};

const theme = extendTheme({ colors });

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Box
        bg="linear-gradient(180deg, #5FBDF4 0%, #336AAC 100%)"
        w="100vw"
        h="100vh"
      >
        <Container bg="white" maxW="container.lg" h="100%" centerContent>
          <Box pr={3}>
            <img src="op_logo.png" />
          </Box>
        </Container>
      </Box>
    </ChakraProvider>
  );
}

export default App;
